var b="url",c="xmgl_03_05_01中检结项批次-点击规则设置.html",d="generationDate",e=new Date(1643071777767.99),f="defaultAdaptiveView",g="name",h="",i="size",j="width",k=0,l="height",m="adaptiveViews",n="sketchKeys",o="s0",p="variables",q="OnLoadVariable",r="juese",s="show",t="DarkWindow",u="yewu_No",v="Data_No",w="Message_loading",x="Name_hetong",y="AxPlusSN",z="shaixuan",A="yang",B="page",C="packageId",D="812732898d734cf7a7e339516a538b1a",E="type",F="Axure:Page",G="XMGL_03_05_01中检结项批次-点击规则设置",H="notes",I="annotations",J="fn",K="1",L="ownerId",M="b6be27fb989148d3a6b0862c4fe4caa3",N="label",O="纵向项目所有项目分类",P="说明",Q="<p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">系统默认规则，可编辑，不可删除</span></p>",R="2",S="363c3c3f227747d4aaa7f9e2569fcdef",T="7",U="e38cb583b456421e80012c7ffd6ad1c5",V="D0218_中检结项批次-点击新增",W="<p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">1.</span><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">不能新增相同项目分类，子项未设置，继承父项</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\"><br></span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\"><br></span></p>",X="8",Y="246cdaca03454cb6b829809e0c349a8a",Z="编辑",ba="<p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">【允许编辑前置条件】</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">——无任一项目满足中检/结项条件</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\"><br></span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">【不允许编辑前置条件】</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">——任一项目能够进行中检/结项</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\"><br></span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\"><br></span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\"><br></span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\"><br></span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\"><br></span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\"><br></span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">—— 【以下信息忽略】</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\"><br></span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">1）该规则内项目没有发生过中检/结项申请行为</span><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">，或发生申请行为并审核通过</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\"><br></span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">——可以进行编辑，为剩余项目（未进行中检/结项的项目）有效</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\"><br></span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">2）该规则内有项目发生过中检/结项申请行为，且未审核通过</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\"><br></span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">不允许</span><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">编辑</span><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">，提示：</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">“已有项目提交中检申请（提交结项申请），不允许</span><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">编辑</span><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">”</span></p>",bb="9",bc="a006767268774ff6b11b6af95ada8ec5",bd="删除",be="<p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">管理规则定义：</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">1.</span><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">在规则内，才出现在项目中检</span><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">/</span><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">结项</span><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">列表</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">——不限制。项目立项审核通过后就可以提交中检/结项</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">——按时间管理。在限定的时间范围内允许提交</span><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">中检/结项</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">——按批次管理。在所在批次的时间范围内允许提交中检/结项，没有批次不能提交中检/结项</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\"><br></span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">2.规则可以按照项目分类设置，但最终作用于项目</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">——如已经被设置为某一批次的项目，在更改管理规则后，新的规则只影响未设置的项目</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\"><br></span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">3.删除提示</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">——前两个为系统内置，不允许删除，可以更改规则类型</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">——【删除提示】</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">1）该规则内项目没有发生过中检/结项申请行为</span><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">，或发生申请行为并审核通过</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\"><br></span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">提示：</span><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">“删除后，中检管理规则将变更为默认规则，是否继续？”</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\"><br></span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">提示：</span><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">“删除后，</span><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">结项</span><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">管理规则将变更为默认规则，是否继续？”</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\"><br></span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">2）该规则内有项目发生过中检/结项申请行为，且未审核通过</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\"><br></span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">不允许删除，提示：</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">“已有项目提交中检申请（提交结项申请），不允许删除”</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\"><br></span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">【项目批次和管理规则，前者优先，后者让步】</span></p><p><span style=\"font-family:'Arial Normal', 'Arial', sans-serif;\">比如，批次选择了国自科分类下50%的项目为某一中检批次，后又对国自科设置了规则按时间管理，后设置的规则只对剩余的50%国自科项目有效，对于批次项目无效；但是如果项目被移除批次，那就按管理规则-按时间管理规则执行；同理，如果先设置了国自科按时间管理，再新增批次时，项目选择中就选不到国自科项目</span></p>",bf="style",bg="baseStyle",bh="627587b6038d43cca051c114ac41ad32",bi="pageAlignment",bj="near",bk="fill",bl="fillType",bm="solid",bn="color",bo=0xFFFFFFFF,bp="image",bq="imageAlignment",br="imageRepeat",bs="auto",bt="favicon",bu="sketchFactor",bv="0",bw="colorStyle",bx="appliedColor",by="fontName",bz="Applied Font",bA="borderWidth",bB="borderVisibility",bC="borderFill",bD=0xFF797979,bE="cornerRadius",bF="cornerVisibility",bG="outerShadow",bH="on",bI=false,bJ="offsetX",bK=5,bL="offsetY",bM="blurRadius",bN="spread",bO="r",bP=0,bQ="g",bR="b",bS="a",bT=0.349019607843137,bU="adaptiveStyles",bV="interactionMap",bW="onLoad",bX="eventType",bY="页面Load时",bZ="description",ca="页面 载入时",cb="cases",cc="conditionString",cd="isNewIfGroup",ce="caseColorHex",cf="AB68FF",cg="actions",ch="action",ci="linkWindow",cj="打开 javascript:<br>var _hmt = _hmt || [];<br>(function() {<br>&nbsp; var hm = document.createElement(&quot;script&quot;);<br>&nbsp; hm.src = &quot;https://hm.baidu.com/hm.js?ce6a2b075db3f74d2ec8a8c1affe89e4&quot;;<br>&nbsp; var s = document.getElementsByTagName(&quot;script&quot;)[0]; <br>&nbsp; s.parentNode.insertBefore(hm, s);<br>})(); 在 当前窗口",ck="displayName",cl="打开链接",cm="actionInfoDescriptions",cn